import React from 'react';

class DetailBox extends React.Component{

  render(){
    return( 
       <div
        className={this.props.class}
        onClick={()=> this.props.onClick()}
        >
            <div className="icon">
            <img src='../assets/pointsIcon.png' alt="Points"></img>
            </div>
            {this.props.value}
        </div>
    );
  }
}
export default DetailBox;
